<!DOCTYPE html>
<html>
<head>
	<meta charset="utf-8">
	<title>UI5 TypeScript FreeStyle</title>
	<script id="sap-ui-bootstrap"
	        src="https://sapui5.hana.ondemand.com/resources/sap-ui-core.js"
	        data-sap-ui-resourceroots='{
	            "com.asabau.freestyle": "./"
	        }'
	        data-sap-ui-theme="sap_horizon"
	        data-sap-ui-compatVersion="edge"
	        data-sap-ui-oninit="module:sap/ui/core/ComponentSupport"
	        data-sap-ui-async="true"
	        data-sap-ui-xx-waitForTheme="true"
	        data-sap-ui-xx-supportedLanguages="en,de"
	></script>
</head>
<body class="sapUiBody">
	<div data-sap-ui-component data-name="com.asabau.freestyle" data-id="container" data-settings='{"id" : "com.asabau.freestyle"}'></div>
</body>
</html>
